import { Add_Todo } from "../types";
import { Delete_Todo } from "../types";

const initialState = {
  list: [
    
    {
      name: 'Football', description: "Best Every footballs since 1953 's", price: 100,
       file: 'data:image/jpeg;base64,'
    },
    {
      name: 'Football', description: "Best Every footballs since 1953 's", price: 100,
       file: 'data:image/jpeg;base64,'
    },
    {
      name: 'Football', description: "Best Every footballs since 1953 's", price: 100,
       file: 'data:image/jpeg;base64,'
    }
    ],
};
const AddReducer = (state = initialState, action) => {
    switch (action.type) {
        case Add_Todo:
            return {
        ...state,
        list: [
            ...state.list,
               action.payload.data,
        ],
      };
      case Delete_Todo : 
      let DeleteData = state.list.filter((e,i)=> i !== action.id)
      return {
          ...state,
          list : DeleteData,
      }       
    default:
      return state;
  }
};
export default AddReducer;
